$(function() {
	window.utils = function() {} || {};
	window.util = {};
	utils.prototype = {
		post: function(b, c, d) {
			$.ajax({
				type: 'POST',
				cache: false,
				url: b,
				data: c,
				success: d,
				error: function(a) {
					alert(a.status);
				}
			})
		},
		get: function(b, c) {
			$.ajax({
				type: 'GET',
				cache: true,
				url: b,
				success: c,
				error: function(a) {
					alert(a.status);
				}
			})
		},
		callback: function(a, b) {
			$.ajax({
				jsonp: "callback",
				dataType: "jsonp",
				url: a,
				success: b,
				error: b
			})
		},
		
		bindType: function(a, b, c) {
			a.unbind(b).bind(b, c)
		},
		
		query: function(a) {
			var b = new RegExp("(^|&)" + a + "=([^&]*)(&|$)");
			var r = window.location.search.substr(1).match(b);
			if (r != null) return unescape(r[2]);
			return null
		},
		
		init: function() {
			(function(a) {
				window.util = a
			})(window.utils.prototype)
		}
	}
	window.utils.prototype.init()
});